CREATE TABLE car_details (
    id INT PRIMARY KEY AUTO_INCREMENT,
    PPL VARCHAR(50),
    Fuel VARCHAR(20),
    Variant VARCHAR(100),
    EmissionNorm VARCHAR(10),
    MakersName VARCHAR(100),
    HSNCode VARCHAR(20),
    NoOfCylinders INT,
    SeatingCapacity INT,
    CatalyticConverter DECIMAL(10,1),
    UnladenWeight DECIMAL(10,1),
    FrontAxle DECIMAL(10,1),
    RearAxle DECIMAL(10,1),
    AnyOtherAxle DECIMAL(10,1),
    TandemAxle DECIMAL(10,1),
    GrossWeight DECIMAL(10,1),
    TypeOfBody VARCHAR(50)
);


